import React from "react";
import { NavLink } from "react-router-dom";

import "../CSS/matchSelector.css";
function RegisterTypeSelector(props) {
  return (
    <div>
      <br />
      <div className="row">
        <div className="col-1"></div>
        {props.type === "match" ? (
          <div className="col-3">
            <NavLink to="/stats">
              <h6 className="tab">All</h6>
            </NavLink>
          </div>
        ) : (
          <div className="col-3" style={{ marginTop: "10px" }}>
            <NavLink to="/stats">
              <h6 className="">All</h6>
            </NavLink>
          </div>
        )}
        {props.type === "compare" ? (
          <div className="col-3">
            <NavLink to="/compare">
              <h6 className="tab">Compare</h6>
            </NavLink>
          </div>
        ) : (
          <div className="col-3" style={{ marginTop: "10px" }}>
            <NavLink to="/compare">
              <h6 className="">Compare</h6>
            </NavLink>
          </div>
        )}
        {props.type === "rank" ? (
          <div className="col-3">
            <NavLink to="/rank">
              <h6 className="tab">Rank</h6>
            </NavLink>
          </div>
        ) : (
          <div className="col-3" style={{ marginTop: "10px" }}>
            <NavLink to="/rank">
              <h6 className="">Rank</h6>
            </NavLink>
          </div>
        )}
      </div>
    </div>
  );
}

export default RegisterTypeSelector;
